[{"location":"","page":"Home","title":"Home","text":"CurrentModule = MonitoredQuantumCircuits","category":"page"},{"location":"#MonitoredQuantumCircuits","page":"Home","title":"MonitoredQuantumCircuits","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for MonitoredQuantumCircuits.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [MonitoredQuantumCircuits]","category":"page"},{"location":"#MonitoredQuantumCircuits.MonitoredQuantumCircuits","page":"Home","title":"MonitoredQuantumCircuits.MonitoredQuantumCircuits","text":"Test\n\n\n\n\n\n","category":"module"},{"location":"","page":"Home","title":"Home","text":"DAG_Circuit","category":"page"},{"location":"#MonitoredQuantumCircuits.QuantumCircuits.DAG_Circuit","page":"Home","title":"MonitoredQuantumCircuits.QuantumCircuits.DAG_Circuit","text":"DAG_Circuit(Gates::Array{Gate,1})\n\nConstructs a directed acyclic graph (DAG) from a list of gates. The DAG is represented by a list of edges, where each edge is a tuple of two integers. The integers represent the index of the gate that is the source of the edge and the index of the gate that is the target of the edge. The edges are ordered in the same way as the gates in the list of gates. The first edge is the edge that is the source of the first gate and the last edge is the edge that is the target of the last gate. The number of edges in the DAG is equal to the number of gates plus the number of qubits involved in the gates. Tested: No\n\n\n\n\n\n","category":"type"}]
